import { Colors } from "./types";

export const baseColors = {
  failure: "#ED4B9E",
  primary: "#5b7445",
  primaryBright: "#3a3342",
  primaryDark: "#3a3342",
  secondary: "#f75454",
  success: "#ececec",
  warning: "#FFB237",
};

export const brandColors = {
  binance: "#FFFFFF",
};

export const lightColors: Colors = {
  ...baseColors,
  ...brandColors,
  background: "#FFFFFF",
  backgroundDisabled: "#DED9E0",
  contrast: "#191326",
  invertedContrast: "#FFFFFF",
  input: "#eeeaf4",
  tertiary: "#2D2A31",
  text: "#d15ab5",
  textDisabled: "#cb3731",
  textSubtle: "#89248c",
  borderColor: "#E9EAEB",
  card: "rgb(13, 12, 13, 1)",
  gradients: {
    bubblegum: "linear-gradient(139.73deg, #FFFFFF 0%, #FFFFFF 100%)",
  },
};

export const darkColors: Colors = {
  ...baseColors,
  ...brandColors,
  secondary: "#FFFFFF",
  background: "#FFFFFF",
  backgroundDisabled: "#FFFFFF",
  contrast: "#FFFFFF",
  invertedContrast: "#FFFFFF",
  input: "#FFFFFF",
  primaryDark: "#FFFFFF",
  tertiary: "#FFFFFF",
  text: "#FFFFFF",
  textDisabled: "#FFFFFF",
  textSubtle: "#FFFFFF",
  borderColor: "#FFFFFF",
  card: "#FFFFFF",
  gradients: {
    bubblegum: "linear-gradient(139.73deg, #FFFFFF 0%, #FFFFFF 100%)",
  },
};
